import React, { useEffect, useState } from 'react'
import "./Pages.css";

const Computers = () => {
  const [computerData, setComputerData]=useState()
  useEffect(()=>{
    const fetchData=async()=>{
      try{
        const response= await fetch('Next-Store/db.json');
        const data=await response.json();
        setComputerData(data);
      }
      catch(error){
        console.error('melumat yuklenmede sehv', error)
      }
    };
    fetchData()
  },[])
  return (
    <div className='telephones'>
      <div className="left">
        <ul>
          <li><strong>Brendlər</strong></li>
          {computerData && computerData['komputer ve notbuklar']['brendler'].map((brend,index)=>(
            <li key={index} >{brend.name}</li>
          ))}
        </ul>
      </div>
      <div className="right">
      <ul>
          <li><strong>HP</strong></li>
          {computerData && computerData['Komputer ve noutbuklar']['brendler'][0].modellər.map((model, index) => (
            <li key={index}>{model}</li>
          ))}
          </ul>
      </div>

    </div>
  )
}

export default Computers
